import React from "react";
import "./Items.css";
import Icons from "../../UI/Icons/Icons";
import Login from "../../Login/Login";

export default function Items() {
  return (
    <div className="Items">
      <Icons
        type="bag"
        onClick={() => (
          <Login />
          )}
      />
      <Icons type="user" />
    </div>
  );
}
